import React from "react";
import { Link, NavLink } from "react-router-dom";

const NavBar = () => {
  return (
    <ul class="nav nav-tabs">
      <li role="presentation" class="active">
        <a href="#">Home</a>
      </li>
      <li role="presentation">
        <a href="#">Profile</a>
      </li>
      <li role="presentation">
        <a href="#">Messages</a>
      </li>
    </ul>
  );
};

export default NavBar;
